pragma solidity >=0.5.0 <0.6.0;

import "./personnetworking.sol";
import "./erc721.sol";
import "./safemath.sol";


/// @title — A contract that manages transfering person ownership
/// @author — My Name
/// @dev — Compliant with OpenZeppelin's implementation of the ERC721 spec draft
contract PersonOwnership is PersonNetworking, ERC721 {

  using SafeMath for uint256;

  mapping (uint => address) personApprovals;

  function balanceOf(address _owner) external view returns (uint256) {
    return ownerPersonCount[_owner];
  }

  function ownerOf(uint256 _tokenId) external view returns (address) {
    return personToOwner[_tokenId];
  }

  function _transfer(address _from, address _to, uint256 _tokenId) private {
    ownerPersonCount[_to] = ownerPersonCount[_to].add(1);
    ownerPersonCount[msg.sender] = ownerPersonCount[msg.sender].sub(1);
    personToOwner[_tokenId] = _to;
    emit Transfer(_from, _to, _tokenId);
  }

  function transferFrom(address _from, address _to, uint256 _tokenId) external payable {
      require (personToOwner[_tokenId] == msg.sender || personApprovals[_tokenId] == msg.sender);
      _transfer(_from, _to, _tokenId);
    }

  function approve(address _approved, uint256 _tokenId) external payable onlyOwnerOf(_tokenId) {
      personApprovals[_tokenId] = _approved;
      emit Approval(msg.sender, _approved, _tokenId);
    }

}

